import gitHubIcon from "./../img/icons/gitHub-black.svg";

const BtnGitHub = () => {
    return ( 
        <>
    <a href="#!" className="btn-outline">
        <img src={gitHubIcon} alt=""/>
        GitHub repo
    </a>
    </>
    );
}

export default BtnGitHub;
